
update words
    set
        c01 = substr(word, 1, 1),
        c02 = substr(word, 2, 1),
        c03 = substr(word, 3, 1),
        c04 = substr(word, 4, 1),
        c05 = substr(word, 5, 1),
        created_at = CURRENT_TIMESTAMP(),
        updated_at = CURRENT_TIMESTAMP()
where c01 is null;

